import {RoomContext} from '../Context'


export default class Booking extends Component {
    constructor(props){
        super(props)
        //console.log(this.props)
        this.state={
            slug:this.props.match.params.slug
        };
    }
    render(){
        return (
            <>
            <Afternav />
            <FullWidthGrid />
            </>

        );
    }
}
